import React from 'react';
import Footer from '../components/Footer.js';
import Navbar from '../components/Navbar/Navbar.js';

function Contact () {

    state={
        abierto: false,
      }
    
      abrirModal=()=>{
        this.setState({abierto: !this.state.abierto});
      }

    return (
            
           <div className='maincontact'>
               <Navbar/>
                <div className='driversespacio'></div>
                <div className='divform'>
                <form className='formcontact' action="http://localhost:8080/send-email" method="POST">
                    <label>
                        Name:
                        <input type="text" name="name" placeholder='Nombre' />
                    </label>
                    <label>
                        Email:
                        <input type="text" name="email" placeholder='Email'/>
                    </label>
                    <label>
                        Mensaje:
                        <input className='mensaje' type="text" name="message" placeholder='Escriba un mensaje' />
                    </label>
                    <Button className='botonenviar' type="submit" value="Enviar" onClick={this.abrirModal}></Button>
                </form>
                </div>
                <Modal isOpen={this.state.abierto} style={modalStyles}>
                    El mensaje fue envviado
                    <Button color="secondary" onClick={this.abrirModal}>Cerrar</Button>
                </Modal>
                <Footer/>
           </div>
            
    )
    }
    
export default Contact;
